    //     subject: subject,
    //     message: message,
    //     total: total,
    //     to_email: adore.space@mail,
    //   };
    // }

  return (
    <>
      <Header />

      <form ref={form} onSubmit={sendEmail}>
      <label>Name</label>
      <input type="text" name="user_name" />
      <label>Email</label>
      <input type="email" name="user_email" />
      <label>Message</label>
      <textarea name="message" />
      <input type="submit" value="Send" />
    </form>
      <Footer />
    </>
  );
}
export default CheckOut;
